message:
- Ai, Ai das Quadrilhas Públicas.

Quem é que pode aceitar uma bandidagem assim;
Onde nada funciona e o povo vive a sofrer;
É o caos generalizado; de uma administração bandida;
Mercenário engravatado, só pensando enriquecer.

O combustível alavanca a desgraça do país;
Os pedágios envergonham toda a nação;
Até o Bolsonaro já tentou nos ajudar;
Mas andorinha só não faz verão.

BRT é holocausto de trabalhador;
O metrô é concorrência com sardinha em lata;
Preço de ônibus virou coisa de rico;
Legislação de oito horas faz escravos de bandidos.

O MP desta cidade há muito tempo está falido;
Sofre desvio de função, não quer perseguir bandido;
O seu melhor negócio é perseguir trabalhador;
Fazer de tudo pra calar o único pastor.

Tem assalto no boteco, no shopping, na pista, em todo lugar;
No banco, farmácia, na joalheria; quem vão mais matar?
É carro, é moto, é casa, até bicicleta vão levar;
Eu grito, suplico, intervenção militar, é pra já.

Cidade de vagabundos, bandos de democratas;
Fraudam no poder público, loucos psicopatas.

(A VOZ CONTINUA)
